import React from 'react';
import classNames from 'classnames';
import { Link } from 'react-router-dom';
import Image from '../../elements/Image';

const Logo = ({
  className,
  ...props
}) => {

  const classes = classNames(
    'brand',
    className
  );

  return (
    <div
      {...props}
      className={classes}
    >
      <h1 className="m-0">
        <Link to="/">
          <Image
            src={require('https://lh3.googleusercontent.com/h9bIKJttfPn4JEtFsoUt4A1XhQb5d5q6NyVPghrstJ3VfkmLeHgWtCWSySGultvYWLOpH7I8xXUAcKdL_15iUkroPJbc1SbC4aCffbUzNRmztMLb3mb_154QVWCJq4g3i66rM7QDzqeV2hl16shmy6VV_0ExE5NqERHM9elg7dshm4yTmebr21Lj0uG2lAck03uyG1SwNRM7HKvKeihFL5wrZho4lQcWxErKq8K2ZhAzkJUBHG8j_nH3cf5TBZQ_hYoXbSUWKSKzmVgHTuLyb8gYoO8kVJfOtWr3apER4wiD0n8e5o3zoMSKyf9piNMs60AomQs4v7nbtrFJ2zfV72ivUFErkInzqn5VxBBMLug9pQebsuRlzgRSRERB0i3uENy09N4CLAG7Da10XCyTHrU_McIfjReiCHS-6GYEo-1WHhlP1QNvmN7ETqMjD2TywtvIU0T6D6bd9YN7kUzZerRVzJcUH5QnVu4nI1YZsb5HLorNmYySWHyXLRd3wXo4kHLZLgXbgUPTHb4Z22k98BOKxNNWy2K-2BJkKKqK5t-Stmxhj1GsLGGJe8laN0uFIlqOvrD9OROCmRMpRWP1kmU5kLnnG56p9I-6U5JXwQ8H96nRfNdIb4a8a2cAm5ip1msIc6jq3U3J3ogtvA5ZJfhyxgDuyL0WmYWlp7j_YMpSZAd6SbZiItsFcIy_AXuznurqyHOM4uMxzQX7F2PBNpRN=w225-h187-no?authuser=0')}
            alt="Open"
            width={32}
            height={32} />
        </Link>
      </h1>
    </div>
  );
}

export default Logo;
